column8:
アンティークなガラス瓶を思わせるおしゃれな詰め替えボトル<BR>
お風呂で割れたら大変なんて心配は要りません<BR><BR>
樹脂なんです。<BR><BR>
とっても精巧に出来てるので、手に持ってみるまで<BR>分かりませんでした。<BR><BR>
カラー：クリアはちょっと灰色かかった透明<BR>
ピンクは、落ち着いた色合い、白い液体をいれるとカワイイです。<BR>
グリーンはサイダー瓶のような感じ<BR>
アンバーはちょっと茶っぽい色<BR><BR>


サイズ：直径77×高さ260mm<BR>
材質：本体：AS樹脂　ポンプ：ABS樹脂、ポリプロピレン
<BR>容量：520ml<BR><BR>
名称：Tralle Lotion Bottle L<BR>


